func lengthOfLongestSubstring(_ s: String) -> Int {
    var left = 0, maxLength = 0
    var map = Dictionary<Character, Int>()
    let array = Array(s.characters)
    
    for (right, c) in array.enumerated() {
        if map[c] != nil {
            left = max(left, map[c]!)
        }
        maxLength = max(maxLength, right - left + 1)
        map[c] = right + 1

    }
    return maxLength
}

